import React, { Component } from "react";
import Producto from "./Producto";

class App extends Component {
    constructor() {
        super(props)
    }
    render() {
        return (
            <div>
                <Producto
                    productoNombre="Galletitas Don Satur"
                    productoDescripcion="Don Satur Dulces"
                    productoPrecio="25.50"
                    productoSKU="7790586"
                    productoCantidad="2" />
            </div>
        )
    }
}

export default App;
